import './Relatorio.css';
import '../AdmGlobal.css'
import NavAdm from '../../../Component/NavAdm/NavAdm'
import { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom';


function DebitosAdmCad() {

  //const baseUrl = "http://34.28.64.143:8080"
    const baseUrl = "http://localhost:8080"
    const[idEmpresaDebito, setidEmpresaDebito] = useState('')
    const[EmpresaDebito, setEmpresaDebito] = useState([])
    const [postData, setpostData] = useState({
        razaoSocial: '', 
        cnpj: '',
        dataEmissao: '',
        dataVencimento: '',
        parcelas: '',
        valorBoleto: ''
    });

    const handleChanage = (e) => {
        setpostData(prev=>({...prev,[e.target.name]:e.target.value}));
      }

    useEffect(()=>{
        fetch(`${baseUrl}/realtorio/BuscarRelatorioPorDia`, 
            {
                method:'GET',
                headers:{
                    'content-type': 'application/json',
                },
            })
            .then((resp)=> resp.json())
            .then((data)=> {
                setEmpresaDebito(data)
            })
            .catch(err => console.log(err))
    }, [])

    const handleClick=async (e)=>{
        try{
          fetch(`${baseUrl}/cliente/NovoCliente`, {
            method: 'POST',
            headers:{
              'Content-Type': 'application/x-www-form-urlencoded'
            },    
            body: new URLSearchParams({
                'idEmpresa':idEmpresa,
                'razaoSocial': postData.razaoSocial,
                'cnpj': postData.cnpj,
                'dataEmissao':postData.dataEmissao,
                'dataVencimento':postData.dataVencimento,
                'parcelas':postData.parcelas,
                'valorBoleto':postData.valorBoleto
        })})
        .then(navigate("/adm"))     
        setclienteData({
            razaoSocial: '', 
            cnpj: '',
            dataEmissao: '',
            dataVencimento: '',
            parcelas: '',
            valorBoleto: ''
        })
        }catch (err){
          console.log("erro")
        }
      }


    return(
        <>
            <div className="admBoxGeral">
                
                <div className="admBoxNav">
                    <NavAdm></NavAdm>
                </div>

                <div className="admSession">

                    <div className='relatorioBlocoGeral'>
                        <form>
                            <fieldset>Dados da empresa
                                {EmpresaDebito.map((data, i)=>{
                                    return(<>

                                    </>)
                                })}
                                <table>
                                    <tr>
                                       <td>
                                            <label>Razao Social: <br/>
                                            <input type="text" name="nome" id="nome" onChange={handleChanage}/>
                                            </label>
                                       </td>
                                       <td>
                                            <label>CNPJ: <br/>
                                            <input type="text" name="nome" id="nome" onChange={handleChanage}/>
                                            </label>
                                        </td> 
                                    </tr>
                                    <fieldset>Dados de Boleto
                                    <tr>
                                        <td>
                                            <label>Data de Emissão: <br/>
                                            <input type="date" name="dataEmissao" id="dataEmissao" onChange={handleChanage}/>
                                            </label>
                                        </td>
                                        <td>
                                            <label>Data de Vencimento: <br/>
                                            <input type="date" name="dataVencimento" id="dataVencimento" onChange={handleChanage}/>
                                            </label>
                                        </td>
                                    </tr>
                                    <tr>
                                        <td>
                                            <label>Parcelas: <br/>
                                            <input type="number" name="parcelas" id="parcelas" onChange={handleChanage}/>
                                            </label>
                                        </td>
                                        <td>
                                            <label>Valor Total: <br/>
                                            <input type="number" name="valorTotal" id="valorTotal" onChange={handleChanage}/>
                                            </label>
                                        </td>
                                    </tr>
                                    </fieldset>
                                    
                                </table>
                            </fieldset>
                        </form>
                        
                    </div>

                </div>
            </div>
        </>)
}

export default DebitosAdmCad
